import { Container, Box, Typography, Button } from "@mui/material";
import React from "react";
import { useNavigate } from "react-router-dom";

function Error404() {
  const navigate = useNavigate();

  return (
    <>
      <Container
        maxWidth="1600"
        sx={{
          display: "flex",
          flexDirection: "column",
          justifyContent: "center",
          height: "100vh",
        }}
      >
        <Box
          sx={{
            padding: "1em",
            display: "flex",
            flexDirection: "column",
            justifyContent: "center",
            alignItems: "center",
          }}
        >
          <Typography
            sx={{
              fontFamily: "Shadows Into Light, cursive",
              fontSize: "5em",
              fontWeight: "700",
              color: "primary.dark",
            }}
          >
            ERROR 404
          </Typography>
          <Typography
            sx={{
              fontFamily: "Shadows Into Light, cursive",
              fontSize: "3em",
              fontWeight: "400",
              marginTop: "1em",
              color: "primary.dark",
            }}
          >
            PAGE NOT FOUND
          </Typography>
          <Button
            variant="contained"
            onClick={() => navigate(-1)}
            sx={{
              backgroundColor: "primary.main",
              marginTop: "1em",
              fontFamily: "Shadows Into Light, cursive",
              fontSize: "3em",
              fontWeight: "500",
              width: "40%",
              borderRadius: "20px",
            }}
          >
            GO BACK
          </Button>
        </Box>
      </Container>
    </>
  );
}

export default Error404;
